package homework12;

public class review01 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
//		 Write a program to print counting numbers 
//		 from 10 to 57 on the console by using for-loop
		
		
		int sum = 0;
		for(int i=10; i<=57; i++) {
			sum = sum + i;
		
		}
		System.out.println(sum);
		
		
		
	}

}
